import React, { Component } from "react";
import { Container} from "semantic-ui-react";
import { withTranslation } from "react-i18next";
import DesktopBreakpoint from "../../components/Responsive_utillities/desktop_breakPoint";
import PhoneBreakpoint from "../../components/Responsive_utillities/phone_breakPoint";
import "./generalSection.css";
import Safety from "./Safety";
import Convenience from "./Convenience";
import Privacy from "./Privacy";
import Variety from "./Variety";
import Reliability from "./Reliability";
import OpenMarket from "./openMarket";
import TabletGeneralSection from "./TabletGeneralSection";

class GeneralSection extends Component {
  render() {
    return (
      <Container>
        <DesktopBreakpoint name="desktop">
         <TabletGeneralSection/>
        </DesktopBreakpoint>

        <PhoneBreakpoint name="phone">
          <Safety />
          <Convenience />
          <Privacy />
          <Variety />
          <Reliability />
          <OpenMarket />
        </PhoneBreakpoint>
      </Container>
    );
  }
}
export default withTranslation("landingPage")(GeneralSection);
